import React, {Component} from "react";
import { DataGrid } from '@mui/x-data-grid';

const columns = [
    {
        field:"id",
        headerName:"Id"
    },
    {
        field:"Name",
        headerName: "Название"
    }
]

const controllerUrl = "departments/";

export class Departments extends Component{
    constructor(props){
        super(props);
        this.state = {departments:[], loading:true};
    }

    componentDidMount(){
        this.populateDepartmentsData();
    }

    render(){
        return(
        <table className='table table-striped' aria-labelledby="tabelLabel">
        <thead>
            <tr>
                <th>Id</th>
                <th>Name</th>
            </tr>
        </thead>
        <tbody>
            {departments.map(department =>
                <tr key={department.date}>
                    <td>{department.id}</td>
                    <td>{department.name}</td>
                </tr>
            )}
        </tbody>
    </table>
    )
    
    }

    async populateDepartmentsData(){
        const response = await fetch(variables.API_URL + controllerUrl + "getdepartments");
        const data = response.json();
        this.setState({department: data, loading:false})
    }
}
